async function getAvatars(){let a,r=!0;try{window.fetch}catch(t){r=!1}a=r?window.fetch:(await import("node-fetch")).default;let c;try{c=await a("https://randomavatar.com/more.php")}catch(t){c=await a("https://api.allorigins.win/raw?url=https://randomavatar.com/more.php")}const t=await c.text();return Array.from(t.matchAll(/(https:\/\/cdn\.cloudflare\.steamstatic\.com.*?)"/g)).map(t=>t[1])}export default getAvatars;